64 GiB of stable memory Persistent across upgrades Familiar API Must specify memory id No migrations per memory id Stable structures are data structures with familiar APIs that allow access to stable memory. Stable memory is a separate memory location from the heap that currently allows up to 64 GiB of storage. Stable memory persists automatically across upgrades. Persistence on the Internet Computer (IC) is very important to understand. When a canister is upgraded (its code is changed after being initially deployed) its heap is wiped. This includes all global variables. On the other hand, anything stored in stable memory will be preserved. Writing and reading to and from stable memory can be done with a low-level API , but it is generally easier and preferable to use stable structures. Azle currently provides one stable structure called StableBTreeMap. It's similar to a JavaScript Map and has most of the common operations you'd expect such as reading, inserting, and removing values. Here's how to define a simple StableBTreeMap: import { nat8, StableBTreeMap, text } from 'azle'; let map = StableBTreeMap(nat8, text, 0); This is a StableBTreeMap with a key of type nat8 and a value of type text. Key and value types can be any Candid type . This StableBTreeMap also has a memory id of 0. Each StableBTreeMap instance must have a unique memory id between 0 and 254. Once a memory id is allocated, it cannot be used with a different StableBTreeMap. This means you can't create another StableBTreeMap using the same memory id, and you can't change the key or value types of an existing StableBTreeMap. This problem will be addressed to some extent . Here's an example showing all of the basic StableBTreeMap operations: import { bool, Canister, nat64, nat8, Opt, query, StableBTreeMap, text, Tuple, update, Vec
} from 'azle'; const Key = nat8;
const Value = text; let map = StableBTreeMap(Key, Value, 0); export default Canister({ containsKey: query([Key], bool, (key) => { return map.containsKey(key); }), get: query([Key], Opt(Value), (key) => { return map.get(key); }), insert: update([Key, Value], Opt(Value), (key, value) => { return map.insert(key, value); }), isEmpty: query([], bool, () => { return map.isEmpty(); }), items: query([], Vec(Tuple(Key, Value)), () => { return map.items(); }), keys: query([], Vec(Key), () => { return map.keys(); }), len: query([], nat64, () => { return map.len(); }), remove: update([Key], Opt(Value), (key) => { return map.remove(key); }), values: query([], Vec(Value), () => { return map.values(); })
}); With these basic operations you can build more complex CRUD database applications: import { blob, Canister, ic, Err, nat64, Ok, Opt, Principal, query, Record, Result, StableBTreeMap, text, update, Variant, Vec
} from 'azle'; const User = Record({ id: Principal, createdAt: nat64, recordingIds: Vec(Principal), username: text
}); const Recording = Record({ id: Principal, audio: blob, createdAt: nat64, name: text, userId: Principal
